import React from 'react';

const List = () => {
  return (
    <div className="List">
      <ul>
        <li>HTML</li>
        <li>CSS</li>
        <li>JS</li>
        <li>React</li>
        <li>Redux</li>
      </ul>
    </div>
  );
}

export default App;
